import classNames from 'classnames/bind';
import styles from './ManageLayout.module.scss';
import { Layout, Menu } from 'antd';
import { Link } from 'react-router-dom';

const { Sider, Content } = Layout;

const cx = classNames.bind(styles);

function ManageLayout({ children }) {
    return (
        <Layout className={cx('wrapper')}>
            <Sider width={320} className={cx('sidebar')}>
                <div className={cx('logo')}>
                    <img
                        src="data:image/png;base64,"
                        alt=""
                    />
                </div>
                <Menu defaultSelectedKeys={['1']} className={cx('menu')}>
                    <Menu.Item key="1" className={cx('menu-item')}>
                        <Link to="/manage/profile">Posts</Link>
                    </Menu.Item>
                    <Menu.Item key="2" className={cx('menu-item')}>
                        <Link to="">Logout</Link>
                    </Menu.Item>
                </Menu>
            </Sider>

            {/* Content ch√≠nh */}
            <Layout className={cx('main-content-layout')}>
                <Content className={cx('content')}>{children}</Content>
            </Layout>
        </Layout>
    );
}

export default ManageLayout;
